formatISODate.code:
function formatISODate(date) {
	if (!date) {
		return null
	}
	return date.toISOString()
}

formatUserLists.code:
function formatUserLists(lists) {
	if (!lists.length) {
		return undefined
	}
	return (lists || []).map(list => list.listId)
}

formatEmailFiles.code:
function formatEmailFiles(files) {
	if (files && files.length) {
		const attachments = {}
		files.forEach(file => {
			attachments[file.fileName] = file.data.toString('base64')
		})
		return attachments
	}
	return null
}

getAttributeType.code:
function getAttributeType(item) {
	if (item.type === 'boolean') {
		return 'boolean'
	}
	if (item.type === 'float') {
		return 'number'
	}
	if (item.type === 'date') {
		return 'date'
	}
	return 'text'
}

formatFolderLists.code:
function formatFolderLists(lists) {
	return (lists || []).map(list => {
		return {
			label: `${list.name} (${list.total_subscribers || 0})`,
			value: list.id
		}
	})
}

formatArrayToObject.code:
function formatArrayToObject(arr, key, value) {
	if (!arr || arr.length === 0) {
		return null
	}
	const obj = {}
	arr.forEach(el => {
		obj[el[key]] = el[value]
	})
	return obj
}

formatArrayToString.code:
function formatArrayToString(arr, separator = '|') {
	if (arr === null || arr === undefined || arr.length === 0) {
		return null
	}
	return arr.join(separator)
}

formatObjectToArray.code:
function formatObjectToArray(obj, first, second) {
	if (!obj || !obj[first]) {
		return null
	}
	return [obj[first], obj[second]]
}

formatUserAttributes.code:
function formatUserAttributes(params) {
	const attrs = {}
	Object.keys(params)
	.filter(key => key.startsWith('custom_'))
	.filter(key => params[key] != null)
	.forEach(key => {
		let value = params[key]
		if (value === true) {
			value = 1
		}
		if (value === false) {
			value = 0
		}
		attrs[key.substr(7)] = value
	})
	return attrs
}

getUserInformationOutput.code:
function getUserInformationOutput(data) {
	if (!data || !data.email) {
		return
	}
	const results = {
		email: data.email,
		lists: data.listid,
		blacklisted: data.blacklisted === 1,
		blacklistedSms: data.blacklisted_sms === 1
	}
	Object.keys(data.attributes).forEach(key => {
		results[`custom_${key}`] = data.attributes[key]
	})
	return results
}
